} pub trait Card { fn suit(self) -> Suit; fn value(self) -> u8;
} fn play_game_with_deck<T>(a: Vec<T>) where T: Card { // insert some creative card game here } Now, if you want to use the function play_game_with_deck with your own personal struct, you must implement Card for your struct. Note that the following code example assumes a dependency games has been included in the Forc.toml file. script;
use games::*;
struct MyCard { suit: Suit, value: u8
} impl Card for MyCard { fn suit(self) -> Suit { self.suit } fn value(self) -> u8 { self.value }
} fn main() { let mut i = 52; let mut deck: Vec<MyCard> = Vec::with_capacity(50); while i > 0 { i = i - 1; deck.push(MyCard { suit: random_suit(), value: i % 4} } play_game_with_deck(deck);
